import React from 'react';
import PlanetCard from './PlanetCard'

const Content = ({planets}) => {
    return (
        <div>
            if (planets.length > 0){}
            <PlanetCard name={planets[0].name} terrain={planets[0].name} gravity={planets[0].name} climate={planets[0].name}/>
            }
        </div>
    );
}

export default Content;
